import'./App.css'
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div>
      <h1>Welcome to MovieLand</h1>
      <p className='paragraph'>Explore our collection of movies</p>
      <Link to="/MoviePage">
        <button className=''>Go to Movie Page</button>
      </Link>
    </div>
  );
}
